import { Widget } from './skl-ds-widget';

export default {
  title: 'Example/Molecules/skl-ds-widget',
  component: Widget,
  argTypes: {
    tag: {
      control: {
        type: 'select', 
        options: ['h1', 'h2', 'p']
      },
      description: 'Tipo di elemento HTML (h1, h2, p)',
    },
    children: {
      control: 'text',
      description: 'Contenuto del testo',
    },
  },
};
